import { Climber } from "./Climber"
export function ClimberList(){
  const [climbers, setClimbers] = useState([]);

  useEffect(() => {
    // Wczytaj dane z pliku JSON
    fetch("./data/climbers.json")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Failed to fetch data");
        }
        return response.json();
      })
      .then((data) => setClimbers(data))
      .catch((error) => console.error("Error loading climbers:", error));
  }, []);

    return (
        <ul className="App" style={{ color : "grey", font : "-moz-initial"}}>
          {climbers.length === 0 && "No Climbers"}
          {climbers.map(climber => {
            return (
              <Climber className = "climberUL"
                {...climber}
              />
            )
          })}
        </ul>
      )
}
